import React from 'react';
import './Stories.css';

import Story from './Story';

const COLUMNS = {
  title: {
    label: 'Title',
    width: '40%',
  },
  author: {
    label: 'Author',
    width: '30%',
  },
  comments: {
    label: 'Comments',
    width: '10%',
  },
  points: {
    label: 'Points',
    width: '10%',
  },
  archive: {
    width: '10%',
  },
};

const Stories = ({ stories }) =>
<div className="stories">
  {(stories || []).map(story =>
    <Story
      key={story.objectID}
      story={story}
      columns={COLUMNS}
    />
  )}
</div>

export default Stories;
